import React, { PureComponent } from 'react'

export default class About extends PureComponent{
    constructor(props){
        super(props)
        this.state={}
    }

    getYears = () =>{
        let today = new Date();
        var year = today.getFullYear();
        year = year - 2017;
        return year;

    }

    render(){
        let years = this.getYears();

        return(
            <div>
                <h4>{years}</h4>
            </div>
        )
    }
}
